import './App.css';
import Home from './Components/Home';
import Expenses from './Components/Expenses';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/expenses" element={<Expenses/>}/>
    </Routes>
  </BrowserRouter>
  );
}

export default App;
